class UmHymnsDeathOfTheBeliever {
  static List<HymnsContent> list = [
    HymnsContent(id: 2962, position: 1, content: "Akamba vetu kilu lieve\nTu va sole ciwa.\nPuãi tu ci okuti kuiya eteke\nLiokufa, hã va tu sia.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_319, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2963, content: "Kofeka ya Yesu\nKa ku li oku usika\nNda tua pitilako\nKa tu litepa vali.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_319, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2964, position: 2, content: "Tu sumua sumua calua eci\nVakuetu va tu sia.\nPuãi haimo tua kolela okuti\nVa kala hu komuenyo.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_319, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2965, position: 3, content: "Vakuetu va pitilako ale,\nVa li oku tu payula.\nOco tu kala hu kofeka\nYesanju li enda hu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_319, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2966, position: 1, content: "Nda ñasi la Yesu\nNda koka ocili.\nOndaka yaye omuenyo\nLesanju ka li pui.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_320, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2967, position: 2, content: "Vetimba liositu\nÑasimo omangela;\nEteke sondolokamo\nMitila kulamba.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_320, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2968, position: 3, content: "Ñasi vovisala.\nNda lunga kovailu.\nEtali nda malusula\nEtulo likuavo.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_320, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2969, position: 4, content: "Voluali nda tala\nOhali longongo,\nNdoku livela epuyuko\nLi kasi ku Yesu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_320, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2970, position: 1, content: "Ñoka vovoko a Yesu,\nÑoka konete yahe;\nOcilelembia cange\nCi puyuka u tate.\nAngelo va imba isungo;\nNjevako luhasa,\nNdete ovapia a Suku,\nLociva culamba.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_321, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2971, content: "Ñoka vovoko a Yesu,\nÑoka ponete yahe.\nOcilelembia cange,\nCi puyuka u tate.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_321, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2972, position: 2, content: "Ñoka vovoko a Yesu,\nAme si teliwa.\nYesu O mbindikiya,\nHa tula utima.\nKa muiya olohali,\nVina viovakandu.\nKa muiya ocikusa\nCi linga Eliapu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_321, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2973, position: 3, content: "Ñoka vovoko a Yesu\nAme si liweka;\nMuli ekoka liange,\nSi ka sondoloka.\nKa muiya asuẽlela,\nKa muiya ohele.\nÑala vovoko a Yesu\nOmo munene.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_321, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2974, position: 1, content: "Oku pekela vu Yesu.\nOku pinduka lesanju;\nOku puyuka ocili;\nOku yovoka kohali.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_322, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2975, position: 2, content: "Kukuekolelo lia Yesu,\nEyambo ombundi yokilu.\nUkristu haimo a vinjuka,\nMua pua ohele, mua koka.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_322, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2976, position: 3, content: "Mu pua owelema, weyambo\nUsumba sio. O pekela\nNdo vula woku puyuka.\nOmele o pasukamo.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_322, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2977, position: 4, content: "Oku lalela kovailu\nOku lavoka epinduko;\nO tuwa ndeci ca Yesu,\nKa fi vali; o kala hũ.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_322, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2978, position: 1, content: "Ka ku li okufa\nKomanu va Suku.\nVa ka tumãla lesanju\nVovoko a Yesu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_323, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2979, position: 2, content: "Ka ku li okufa\nKu u Yesu wo fila.\nEtimba ndaño li vola,\nUtima ko fi mbu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_323, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2980, position: 3, content: "Ka ku li okufa\nKu wa sia akandu.\nOkufa ku tu pitiya\nKofeka yulamba.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_323, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2981, position: 4, content: "Ka ku li okufa\nKu o kuama Yesu.\nIñila laye lesanju\nVofeka ka yi pui.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_323, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2982, position: 1, content: "Eci utima wa lemiwa\nLovitele viovasumuo,\nPamue nda upongo wa lua,\nYesu o tu lembeleka.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_324, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2983, position: 2, content: "Nda tua sima oku konyoha,\nOmo via lua vi tu vala,\nPamue nda tua sanga epembe,\nYesu o tu lembeleka.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_324, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2984, position: 3, content: "Eci utima u nyikiwa\nLevi vi lingisa usumba,\nKa tu ka vi yokokeli.\nYesu o tu vindikiya.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_324, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2985, position: 4, content: "Eci akamba etu a tu sia\nHa va yoki olui luokufa,\nTu koleli epinduko.\nYesu eye Omuenyo wetu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_324, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2986, position: 1, content: "Lalapo, okuetu. Lalapo ciwa;\nOpo wa pitila kepuyuko.\nOhali yove yosi ya imuha,\nLalapo ciwa, okuetu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_325, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2987, position: 2, content: "Katoke undembo wosi wimuha,\nKatoke upongo wosi u pita,\nKatoke tu lisanga kimbo lia'e,\nLalapo ciwa okuetu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_325, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2988, position: 3, content: "Katoke Yesu o tukuluka,\nKatoke ulamba wa'e u moleha,\nKatoke va Yesu va pinduka\nLalapo ciwa, okuetu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_325, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2989, position: 4, content: "Katoke oku lila ku imuha,\nKatoke okufa ku yuliwa pe,\nKatoke tu limuila kulamba,\nLalapo ciwa, okuetu.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_325, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2990, position: 1, content: "Nyihe ekolelo liasuapo,\nLioku iñila kilu,\nHa mole ulamba ukasiko,\nWa vakuetavo.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_326, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2991, content: "Valua vakuetavo vaka nalamela.\nVa tumãla kocalo.\nValua alaka vali loku ñovonga,\nLokuimba lutoi.\nVa ñovonga oko.\nVa ñovonga oko,\nKo Yelusalãi yokaliye.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_326, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2992, position: 2, content: "Kulo va tala olohali,\nOtokua loku lila.\nVayula ositu la Satana,\nValunga kulamba.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_326, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2993, position: 3, content: "Helie wa va iha eyulo eli?\nSapuile a manji.\nUna wa fa kekulusu\nHa tu iha eyovo.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_326, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2994, position: 1, content: "Ñala Yesu ci ko kuatela\nOkuti voluali ñuata\nUtima wange wo to lohali?\nO yeva oku sumua kuange?", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_327, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2995, content: "Ndi ci, Yesu olete ciwa\nEci ame nalã ohali.\nKeyako lievihõ lohele hu,\nYesu eye o ñuatisa.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_327, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2996, position: 2, content: "Ñala Yesu ci ko kuatela\nNda ñala lasumuo, omo\nLiokuenda ocinyi sio cekulusu?\nNjovoli o ciyeva?", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_327, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2997, position: 3, content: "Ñala Yesu ci ko kuatela\nNda ñupuka veyonjo,\nNda Satana wa nyupa etavo,\nO ka nyihã ongecelo?", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_327, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2998, position: 4, content: "Ñala Yesu ci ko kuatela\nNda oku fa ku nyolã onjo?\nNdi linga, lalipo, wasoliwi,\nYesu oyeva esumuo liange.", hymnsNumber: UmHymnsNumberSeeder.DEATH_OF_THE_BELIEVER_327, typeStanza: HymnsContentCode.VERSE),

  ];
}